VALUES ('29012497', 'Gemischtes Hackfleisch, 30% fettreduziert', 'Gemischtes Hackfleisch, 30 % fettreduziert zum Braten, aus Schweinefleisch und Rindfleisch 7utaten: 50 % Schweinefleisch&quot;, 50 % Rindfleischl. Verhältnis Kollagen/ Fleischeiweiß geringer als 18 %. Fettgehalt geringer als 13 %.30 % weniger Fett/als in herkömmlich gemischtem Hackfleisch enthalten ist. &quot;QS-Ware Zubereitung: Hackbraten (4 Portionen): 1 Bund in Ringe geschnittene Frühlingszwiebeln mit 400 g gemischtem Hackfleisch, 2 TL Senf, 2TL Tomatenmark,1 Ei, 50 g Paniermehl, 1/2 TL gerebeltem Majoran, 1/2TL Salz, 1/2 TL Paprikapulver und 2 Msp. Pfeffer gut verkneten und Zu einem länglichen Laib von ca. 20 cm Länge und 7 cm Höhe formen. Hackbraten auf ein mit Backpapier ausgelegtes Backblech setzen und im vorgeheizten Backofen ca. 50-60 Min. garen (Elektro - und Erdgasbackofen: 180 °C/Stufe 3, Umluft 160 °C) Dieses Produkt ist vor dem Verzehr durchzuerhitzen! Regeln der guten Küchenhygiene beachten: Rohes Fleisch nicht in Kontakt mit anderen Lebensmitteln bringen. Tropfsaft sorgfältig entsorgen. Geschirr und Hände gründlich reinigen. Dieses Fleisch ist nicht zum Rohverzehr qeeiqnet!', 'https://static.openfoodfacts.org/images/products/29012497/front_de.4.400.jpg', '12', '46', '0', '0', '', '20', '0.15', '0.0591', '', '0');

